(20, 'Access Granted', 'Welcome to the Sagicor Convention 2018 | Montreal! You have been granted access', 'This template is used for email when admin authenticate the user', '<div align=\"center\">\n<table width=\"600\" style=\"background: none repeat scroll 0% 0% rgb(244, 244, 244); border: 1px solid rgb(102, 102, 102);\" border=\"0\" cellspacing=\"5\" cellpadding=\"5\">\n    <tbody>\n        <tr>\n            <th style=\"background-color: rgb(204, 204, 204);\">Welcome to the Sagicor Convention 2018 | Montreal! You have been granted access.</th>\n        </tr>\n        <tr>\n            <td style=\"text-align: left;\">Good Day,<br><p class=\"MsoNormal\">Thank you for requesting your authentication for the Sagicor Convention 2018 website. You have been granted access with the username and password that you specified, and are welcome to peruse the site and register for Convention. Please remember that registration for you and your travel companion must be completed by Friday, March 23rd, 2018.&nbsp;</p><p class=\"MsoNormal\">Username:&nbsp;<strong>[USERNAME]</strong><br>Password:&nbsp;<strong>[PASSWORD]</strong><br></p></td></tr><tr><td style=\"text-align: left;\"><p class=\"MsoNormal\"><span style=\"font-family:\" en-us\"=\"\">Thank you! </span></p>\n\n\n<p class=\"MsoNormal\"><span style=\"font-family:\" en-us\"=\"\">Your Sagicor Travel Team</span></p></td></tr></tbody></table></div>'),
