(18, 'Complete Your Registration', 'Please Complete You Registration', 'This template is used by cron to send email to user, whose registration is not completed yet.', '<div align=\"center\">\n<table width=\"600\" style=\"background: none repeat scroll 0% 0% rgb(244, 244, 244); border: 1px solid rgb(102, 102, 102);\" border=\"0\" cellspacing=\"5\" cellpadding=\"5\">\n    <tbody>\n        <tr>\n            <th style=\"background-color: rgb(204, 204, 204);\">Please Complete Your Registration for the [NAME]!</th>\n        </tr>\n        <tr>\n            <td style=\"text-align: left;\">Good Day,<br><p class=\"MsoNormal\">Please note that your registration is still missing the following required fields. Please return to the website and enter the missing information . . .</p><p class=\"MsoNormal\"><span style=\"font-weight: 700; text-align: center; background-color: rgb(204, 204, 204);\">[BODY]</span><br></p></td>\n        </tr>\n        <tr>\n            <td style=\"text-align: left;\"><!--[if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]-->\n\n\n<p class=\"MsoNormal\"><span style=\"font-family:\" en-us\"=\"\">Your registration should be completed on or before&nbsp;<span style=\"display: inline !important; float: none; background-color: transparent; color: rgb(159, 168, 176); font-family: Arial,Tahoma; font-size: 13px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">Friday, March 23rd, 2018</span></span></p><p class=\"MsoNormal\"><span style=\"font-family:\" en-us\"=\"\">Thank you! </span></p>\n\n\n\n<p class=\"MsoNormal\"><span style=\"font-family:\" en-us\"=\"\">Your Sagicor Travel Team</span></p></td></tr></tbody></table></div>'),
(19, 'Confirm Your Registration', 'Please Confirm Your Registration', 'This template is used by cron to send email to user, who completed their registrations, but not confirm yet.', '<div align=\"center\">\n<table width=\"600\" style=\"background: none repeat scroll 0% 0% rgb(244, 244, 244); border: 1px solid rgb(102, 102, 102);\" border=\"0\" cellspacing=\"5\" cellpadding=\"5\">\n    <tbody>\n        <tr>\n            <th style=\"background-color: rgb(204, 204, 204);\">Please Confirm Your Registration for the [NAME]!</th>\n        </tr>\n        <tr>\n            <td style=\"text-align: left;\">Good Day,<br><p class=\"MsoNormal\">Thank you for filling out the required fields for your Sagicor Convention 2018 registration. Your final step to complete your registration is to review your selections and confirm them. Please go through you registration and click the \"confirm\" button before <span style=\"display: inline !important; float: none; background-color: transparent; color: rgb(159, 168, 176); font-family: Arial,Tahoma; font-size: 13px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\">Friday, March 23rd, 2018</span>.&nbsp;</p>\n<a href=\"https://sagicorconvention.com/demo/sagicorconvention/registration/register\">Click To Go Through Your Registration</a></td></tr><tr><td style=\"text-align: left;\"><p class=\"MsoNormal\"><span style=\"font-family:\" en-us\"=\"\">Thank you! </span></p>\n\n\n<p class=\"MsoNormal\"><span style=\"font-family:\" en-us\"=\"\">Your Sagicor Travel Team</span></p></td></tr></tbody></table></div>');
